import React from "react";
import Tile from "../tile/Tile";

export const TileList = ({ objectList }) => {
  let name;
  let description;

  const tilesToRender = objectList.map((obj) => (
    <Tile name={obj.name} description={
      Object.fromEntries(asArray.filter(([key, value]) => key !== "name"))
    } />
  ));

  return (
    <div>
      {tilesToRender}
    </div>
  );
};
